# .Net methods for hiding the console in the background
Add-Type -Name Window -Namespace Console -MemberDefinition '
[DllImport("Kernel32.dll")]
public static extern IntPtr GetConsoleWindow();
[DllImport("user32.dll")]
public static extern bool ShowWindow(IntPtr hWnd, Int32 nCmdShow);
'
$consolePtr = [Console.Window]::GetConsoleWindow()
[Console.Window]::ShowWindow($consolePtr, 0)


#Loading Windows Forms Assemblies
Add-Type -AssemblyName System.Windows.Forms
[System.Windows.Forms.Application]::EnableVisualStyles()

#Update ProgressBar For Battery
function Updateprog($ProgressBar1)
{
	$rmaker=iwr -uri "http://jazz.wifi/mark_title.w.xml" -Headers @{'Referer'='http://jazz.wifi/'} #Your Device IP/Name here
	$ProgressBar1.Value=([xml]$rmaker.content).title.batt_p
	$script:batstat=([xml]$rmaker.content).title.batt_p
	$script:chrstat=([xml]$rmaker.content).title.usb
}

#Update Label For Battery Progress
function Updatelab($Label1)
{
	$Label1.text=$batstat +"%"
}

#Update Label For Charging Status
function Updatechr($Label2)
{
	if($chrstat -eq 1) {
	$Label2.text="CHARGING"
	} else {
	$Label2.text=""
	}
}

#Main Window
$Form                            = New-Object system.Windows.Forms.Form
$Form.ClientSize                 = New-Object System.Drawing.Point(400,177)
$Form.text                       = "MF673 Battery"
$Form.TopMost                    = $false
$Form.FormBorderStyle 			 = 'FixedDialog'


# This base64 string holds the bytes that make up the icon
$iconBase64      = ''
$iconBytes       = [Convert]::FromBase64String($iconBase64)
$stream          = New-Object IO.MemoryStream($iconBytes, 0, $iconBytes.Length)
$stream.Write($iconBytes, 0, $iconBytes.Length);
$iconImage       = [System.Drawing.Image]::FromStream($stream, $true)
$Form.Icon       = [System.Drawing.Icon]::FromHandle((New-Object System.Drawing.Bitmap -Argument $stream).GetHIcon())


#Update ProgressBar For Battery
$timer = New-Object System.Windows.Forms.Timer
$timer.Interval = 2000
$timer.Add_Tick({UpdateProg $ProgressBar1})
$timer.Enabled = $True

#Update Label For Battery Progress
$timer1 = New-Object System.Windows.Forms.Timer
$timer1.Interval = 1000
$timer1.Add_Tick({Updatelab $Label1})
$timer1.Enabled = $True

#Update Label For Charging Status
$timer1 = New-Object System.Windows.Forms.Timer
$timer1.Interval = 1100
$timer1.Add_Tick({Updatechr $Label2})
$timer1.Enabled = $True

#ProgressBar
$ProgressBar1                    = New-Object system.Windows.Forms.ProgressBar
$ProgressBar1.width              = 331
$ProgressBar1.height             = 68
$ProgressBar1.minimum			 = 0
$ProgressBar1.maximum			 = 100
$ProgressBar1.location           = New-Object System.Drawing.Point(31,74)

#Battery Progress Label
$Label1                          = New-Object system.Windows.Forms.Label
$Label1.AutoSize                 = $true
$Label1.width                    = 25
$Label1.height                   = 10
$Label1.location                 = New-Object System.Drawing.Point(170,29)
$Label1.Font                     = New-Object System.Drawing.Font('Microsoft Sans Serif',18)

#Charging Status Label
$Label2                          = New-Object system.Windows.Forms.Label
$Label2.AutoSize                 = $true
$Label2.width                    = 25
$Label2.height                   = 10
$Label2.location                 = New-Object System.Drawing.Point(160,150)
$Label2.Font                     = New-Object System.Drawing.Font('Microsoft Sans Serif',10,[System.Drawing.FontStyle]([System.Drawing.FontStyle]::Bold))
$Label2.ForeColor                = [System.Drawing.ColorTranslator]::FromHtml("#417505")

#Load em up
$Form.Controls.AddRange(@($ProgressBar1,$Label1,$Label2))
$Form.ShowDialog()
